Puss in Boots is a talking cat named for his wearing boots and is a fugitive on the run from the law, looking to restore his lost honour. He learns that the outlaw couple Jack and Jill have the magic beans he's been looking for most of his life, beans that can lead him to a giant's castle holding valuable golden goose eggs. When Puss tries to steal them from the outlaws' room, female cat Kitty Softpaws interrupts, and both fail. Kitty is allied with Humpty Alexander Dumpty, a talking egg and Puss' long-estranged childhood friend from the orphanage where he was raised. Puss tells Kitty his origin story and of his feelings of betrayal for a youthful misadventure when Humpty tricked Puss into helping commit a bank robbery; Puss has been on the run since. Humpty convinces Puss to join them in finding the beans and retrieving the golden eggs..The events leading up to the sword fighting cat's meeting with Shrek and his friends.

